window.bookSummaryJSON = "<p><b>Kadia Greene believed she had found her place in the digital realm, but her new life is upended when she is abruptly pulled back into the harsh reality she thought she had left behind forever.</b></p> <p>Torn between the lure of returning to her digital haven and the unresolved issues of her past, Kadia faces the daunting challenge of navigating her new circumstances while grappling with a fractured sense of self. Each decision she makes now will not only define her future but also force her to reconcile the person she was with the person she must become.</p>"; 
